// Access the global variable CurrentPage.folder
const folderPath = globalContext.page?.['folder'];

// Check if folderPath exists and is a string
if (typeof folderPath === 'string') {
  // Remove special characters at the end of the text string
  const trimmedFolderPath = folderPath.replace(/[^a-zA-Z0-9]+$/, '');

  // Return the result
  return trimmedFolderPath;
}

// Return an empty string if folderPath is undefined or not a string
return '';
